config.script:
selectedRowData = self.parent.parent.parent.getChild("Row2/Materials").props.selection.data
modalName = "addMaterials"
modalPath = "App/Schedule/Materials/Embedded/Popups/Add/AddManualMaterials"

params = {
	"ModalName": modalName,
	"RowData": selectedRowData
}

errorParams = {
	"ModalName": "ErrorModal",
	"ErrorMessage": "Please select a row first!"
}

if len(selectedRowData) > 0:
	system.perspective.openPopup(modalName, modalPath, params, title="Add", modal=True, overlayDismiss=True)
else:
	system.perspective.openPopup("ErrorModal", "GlobalComponents/Modals/ErrorModal", errorParams)

selectedRowData = self.parent.parent.parent.getChild("Row2/Materials").props.selection.data
modalName = "editMaterial"
modalPath = "App/Schedule/Materials/Embedded/Popups/Edit/EditManualMaterials"

params = {
	"ModalName": modalName,
	"RowData": selectedRowData
}

errorParams = {
	"ModalName": "ErrorModal",
	"ErrorMessage": "Please select a row first!"
}

if len(selectedRowData) > 0:
	system.perspective.openPopup(modalName, modalPath, params, title="Edit", modal=True, overlayDismiss=True)
else:
	system.perspective.openPopup("ErrorModal", "GlobalComponents/Modals/ErrorModal", errorParams)

queryPath = 'app/Schedule/deleteMaterial'
materialID = self.view.custom.RowData[0].ID

params = { 'id': materialID }

try:
	system.db.runNamedQuery(queryPath, params)
	self.view.refreshBinding('custom.Data')
except Exception as e:
	errorParams = {
		"ModalName": "ErrorModal",
		"ErrorMessage": "The request could not be completed! " + str(e) 
	}

	system.perspective.openPopup("ErrorModal", "GlobalComponents/Modals/ErrorModal", errorParams)
